🌞🌊👁️Summer giveaway 🖤🐛🌺

I’m very excited to share this fun giveaway with you all! For my first giveaway, 5 other other eye loving artists and myself are teaming up to share our work. Each of us will be giving away a prize so there are lots of chances to win! (6 winners!) Scroll through the slides to check them out!

Artists:
@eyeba.nyc - $150 gift card
@tankturner - 🍄Mushroom Charm🍄
@inkspired - Wooden Hand sculpture 
@beansofjohn - Original sculpture (US & Canada only)
@ajporcelain - 3inch porcelain dish (US only) 
@velvetmush - Print mounted to wood 

🌟To enter:
Follow all artists, like & tag a bud (or 2 or 3!) 😘 in the comments on the main giveaway post @eyeba.nyc gram. Let us know which prizes you hope to win! 🏆
*While it doesn’t count as an entry, everyone is encouraged to share this post to their stories to help us get more eyessss on our work. 👀
Winners will be chosen at random on July 13th at 12 EST. You will be notified via DM from @eyeba.nyc - so keep your eyes peeled for a message from Amanda and make sure to reply ASAP!

⛔️SUPER IMPORTANT!  Beware of scams⛔️
We are only announcing and reaching out to winners from the @eyeba.nyc account . We will NOT be making a new account or a website to ask you to fill anything out. Please be careful of the people trying to get information from you! We will never ask you for credit card information or to fill out any additional forms to complete your entry. These people are tricky! So always double check that the dm is coming from @eyeba.nyc and not something similar.
